    - type: Paper
      content: >-
        Tider Alchemy: Mindbreaker Toxin

        By Devin Foster

         Materials List:
         1 Vial
         1 Beaker
         1 Microwave
         1 Hotplate
         1 Electrolysis Unit
         1 Centrifuge
         1 Reagent Grinder
         1 Damp Rag, Towel, or Mop
         1 Bucket
         4 Glass Sheets
         2 Bananas
         1 Muffin Tin
         1 Dough Slice
         50u Water
         50u Slime
         Step 1: Centrifuge all 50u of the slime, and add it to the bucket.
         Step 2: Using the damp rag, remove the water from the previous mixture.
        Step 3: Juice the two bananas in the grinder, and centrifuge the juice.
         Step 4: Put the processed banana juice from the previous step, the dough
        slice, and the muffin tin into the microwave for 15 seconds.
         Step 5: Add what's left of the processed banana juice into the bucket.
         Step 6: Grind up one of the glass sheets, and add it to the bucket.
         Step 7: Put 5u of the water into a beaker and heat it for over a minute.
        Step 8: Grind the remaining 3 glass sheets into the beaker with the hot water,

        and add the mix to the bucket.
         Step 9: Remove the 5u of water from the bucket using the damp rag.
         Step 10: Electrolyze the remaining 45 units of water, and add it to the bucket
        (pour all of the electrolyzed water in at the same time)
         Step 11: Enjoy.

        NOTES: If a hotplate isn’t obtainable or if purity isn’t a concern, 3 bananas processed in the same manner as Step 3 can be used to turn the oxygen into cryptobiolin. This WILL lower the purity from ~86% to ~67%. Certain other recipes can substitute the muffin recipe used in Step 4
