    - type: Paper
      content: >-
        Tider Alchemy: Two Ingredient Toxic Smoke

        By Devin Foster


        Materials List:

        5 Meat (cannot be human, dwarf, slime, or diona)

        3 Bananas

        1 Vial

        1 Beaker (optional)

        1 Centrifuge

        1 Reagent Grinder

        1 Hotplate (or microwave)

        1 Electrolysis Unit

        1 Bucket

        1 Gas Mask

        1 Gas Tank (varies on race)

        Step 1: Grind the meat in the reagent grinder.

        Step 2: Put the meat slurry into the electrolysis unit.

        Step 3: Heat the meat slurry with the hotplate or microwave.

        Step 4: Transfer the slurry into the bucket. If you are only using the vial,

        repeat steps 1 through 3 until you use all the meat.

        Step 5: Juice the bananas in the reagent grinder.

        Step 6: Put the banana juice into the centrifuge.

        Step 7: Put on the gas mask and toggle your internals.

        Step 8: Pour all of the centrifuged banana juice into the bucket.

        Step 9: Enjoy.
