    - type: Paper
      content: >-
        Tider Alchemy: Making A DIY Plasma Fire

        By Devin Foster


        Materials List:

        3 Plasteel

        6 Plastic

        1 Centrifuge

        1 Electrolysis Machine

        1 Reagent Grinder

        1 Lighter

        1 Bucket

        1 Large Beaker

        1 Vial

        60u Water

        75u Welding Fuel

        Step 1: Centrifuge 50u of the welding fuel and pour it into the bucket.

        Step 2: Grind the 6 plastic and pour it into the bucket.

        Step 3: Pour the remaining 25u of welding fuel into the bucket.

        Step 4: Put all 60u of the water into the electrolysis machine and pour it into

        the bucket. Make sure to pour all 60u at the same time.

        Step 5: Grind up the plasteel.

        Step 6: Move the bucket to the location where you want the plasma fire.

        Step 7: Ignite the lighter, and set it next to the bucket.

