      content: >-
        I own a Kammerer for Brig Defense, since thats what Central Command intended.

        Four Gorlex Operatives blow a hole through my Perma with C4

        "What the devil?" I yell as I grab my Warden's Cap and Kammerer shotgun. Blow 4 .50 caliber holes through the Medic, he's crit on the spot.

        Draw my N1984 on the second guy, miss him entirely because a secoff exploded with Tear Gas, it hits the HOP instead.

        I have to resort to the toolbox in my armory, filled to the brim with explosive payloads. "GLORY TO NANOTRASEN!!" The resulting explosion instagibbing the Commander and a Operative, setting off all the firelocks on station.

        Draw my Stun Baton on the last terrified Operative, he dies from spacing waiting for the paramedic to arrive becuase I took his suit off immediately after cuffing him.


        Just as Central Command Intended.
